import React, { useState, useEffect } from 'react'
import Container from '@mui/material/Container'
import useStyles from './styles'
import Typography from '@mui/material/Typography';
import image from 'assets/detailBackground.jpg';
import Table from '@mui/material/Table'
import TableHead from '@mui/material/TableHead'
import TableRow from '@mui/material/TableRow'
import TableCell from '@mui/material/TableCell'
import { useDispatch, useSelector } from 'react-redux'
import { listMyOrders } from 'actions/orderActions'
import Message from 'components/Message'
import Loader from 'components/Loader'
import TableBody from '@mui/material/TableBody'

const ProfileScreen = () => {
  const classes = useStyles();
  const dispatch = useDispatch()
  const orderListMy = useSelector((state) => state.orderListMy)
  const { loading: loadingOrders, error: errorOrders, orders } = orderListMy
  return (
    <Container
      md={12}
      className={classes.container}
      style={{ background: `url(${image}) no-repeat center/cover` }}
    >
      <Typography style={{fontSize: '40px', textAlign: 'center'}}>My Orders</Typography>
      <Table
      size='small'
      sx={{ minWidth: 650 }}
      aria-label='simple table' 
      >
          <TableHead>
                <TableRow>
                  <TableCell align='left'>ID</TableCell>
                  <TableCell align='left'>Дата</TableCell>
                  <TableCell align='left'>Сумма</TableCell>
                  <TableCell align='left'>Оплачено</TableCell>
                  <TableCell align='left'>Доставлено</TableCell>
                  <TableCell align='left'></TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                  {orders.map((order) => {
                    <TableRow key={order._id}>
                      <TableCell align='left'>{order._id}</TableCell>
                      <TableCell align='left'>{order.createdAt.substring(0, 10)}</TableCell>
                      <TableCell align='left'>{order.totalPrice}</TableCell>
                      <TableCell align='left'>{order.isPaid ? (
                      order.paidAt.substring(0, 10)
                    ) : (
                      <i className='fas fa-times' style={{ color: 'red' }}></i>
                    )}</TableCell>
                      <TableCell align='left'>ID</TableCell>
                      <TableCell align='left'>ID</TableCell>
                    </TableRow>
                  })}
              </TableBody>
      </Table>

    </Container>
  )
}

export default ProfileScreen;
